- Mentoring interns and junior recruiters;- Managing a team of 4 recruiters: distributing vacancies, helping with difficult situations, tracking kpi;- Conducting vacancies for different departments from discussing the candidate’s profile to the hiring of the employee;- Taking part in hiring events, for example, OneDayOffer;- Providing hiring managers all necessary statistics;- Participating in creating a course for recruiters about the basics of IT as an arranger and a teacher.Filling the following vacancies:- Back-end: Golang, C#;- Mobile: iOS (Swift), Android (Kotlin), cross-platform development (Flutter);- QA: Python, C#, Go, mobile;- System and business analytics;- UI/UX designers.- Mentoring interns and junior recruiters;
- Managing a team of 4 recruiters: distributing vacancies, helping with difficult situations, tracking kpi;
- Conducting vacancies for different departments from discussing the candidate’s profile to the hiring of the employee;
- Taking part in hiring events, for example, OneDayOffer;
- Providing hiring managers all necessary statistics;
